import React, {Component} from 'react';

const ImageList = ({images}) => {

    const getImages = images.map(image => {
        return (
            <div>
                <img src={image.urls.small} alt="s"/>
            </div>
        )
    })

    return (
        <div>
            {getImages}
        </div>
    )

}

export default ImageList;
